"   <div class=\"lgnd\">",
"    This electrocardiogram (ECG) of a neonate demonstrates several features consistent with pulmonary atresia with an intact ventricular septum (PA/IVS), including right atrial enlargement based on tall p waves in leads I, II, and aVF, and abnormal relative left axis deviation (QRS axis +30 degrees) due to a decrease of right-sided forces from RV hypoplasia. Cyanosis in a neonate with left axis deviation on ECG should prompt the clinician to consider PA/IVS. Although the ECG does not demonstrate significant myocardial ischemia, ST and T wave abnormalities should be ruled out on all patients with PA/IVS due to the possibility of coronary abnormalities.",
