var title_f1_33_1563="Preventing lead exposure from soil";
var content_f1_33_1563=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F82132&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F82132&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Educational interventions to prevent exposure to lead in soil",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Cover bare soil with grass, plants, gravel, or wood chips",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Do not let children play near walls of house or garage on bare soil",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Have children play in grassy area or sandbox that can be covered",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wash children's hands after playing outside, or playing with pets",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Remove shoes before entering the house",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Use a doormat to reduce track-in of outdoor dust and soil",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Environmental Protection Agency. (file://www.epa.gov/lead/educationexesum.htm).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
