var script_f1_33_1565=[""].join("\n");
var outline_f1_33_1565=null;
var title_f1_33_1566="Pruritus topical therapy";
var content_f1_33_1566=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F50432%7EDERM%2F63221&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F50432%7EDERM%2F63221&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Topical therapies for pruritus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Medication",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Notes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Barrier repair creams/moisturizers/emollients",
"       </td>",
"       <td>",
"        Not applicable",
"       </td>",
"       <td>",
"        Low pH products may be particularly useful",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Topical corticosteroids",
"       </td>",
"       <td>",
"        Variable",
"       </td>",
"       <td>",
"        Not directly antipruritic, may be useful in pruritus due to inflammatory skin dermatoses",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Topical calcineurin inhibitors",
"       </td>",
"       <td>",
"        Tacrolimus 0.03% and 0.1% ointment",
"       </td>",
"       <td rowspan=\"2\">",
"        Particularly useful in anogenital pruritus, may experience transient burning and stinging",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pimecrolimus 1% cream",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Doxepin",
"       </td>",
"       <td>",
"        5% cream",
"       </td>",
"       <td>",
"        Avoid in children, 20 to 25 percent risk of sedation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Menthol",
"       </td>",
"       <td>",
"        1 to 3% cream or lotion",
"       </td>",
"       <td>",
"        Useful in patients who report cooling as an alleviating factor",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Capsaicin",
"       </td>",
"       <td>",
"        0.025 to 0.1% cream",
"       </td>",
"       <td>",
"        Particularly useful in neuropathic itch, may experience initial transient burning",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Salicylic acid",
"       </td>",
"       <td>",
"        2 to 6%",
"       </td>",
"       <td>",
"        Useful in lichen simplex chronicus, avoid in acute inflammatory dermatoses and children",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Local anesthetics",
"       </td>",
"       <td>",
"        Pramoxine 1 to 2.5%",
"       </td>",
"       <td>",
"        Useful for pruritus on face and that associated with CKD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lidocaine patch 5%",
"       </td>",
"       <td>",
"        Useful in neuropathic pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Eutectic mixture of lidocaine 2.5% and prilocaine 2.5%",
"       </td>",
"       <td>",
"        Useful in neuropathic pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5% urea + 3% polidocanol",
"       </td>",
"       <td>",
"        Both moisturizing and anesthetic properties, not available in the United States",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CKD: chronic kidney disease; %: percent.",
"    </div>",
"    <div class=\"reference\">",
"     Patel T, Yosipovitch G. Therapy of pruritus. Expert Opin Pharmacother 2010; 11:1673. Copyright &copy; 2010 Informa Healthcare. Reproduced with permission of Informa Healthcare.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Systemic therapies for pruritus",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Medication*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose range",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle1\">",
"        Notes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Antihistamines",
"        </strong>",
"       </td>",
"       <td>",
"        Variable depending on medication",
"       </td>",
"       <td>",
"        No direct effect on pruritus except in urticaria; sedating antihistamines may be useful through their soporific effects",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Antidepressants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        SNRIs",
"       </td>",
"       <td>",
"        Mirtazapine 7.5 to 15 mg at night",
"       </td>",
"       <td>",
"        Useful in nocturnal pruritus, may cause increased weight and appetite",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"3\">",
"        SSRIs",
"       </td>",
"       <td>",
"        Paroxetine 10 to 40 mg per day",
"       </td>",
"       <td>",
"        Consider in psychiatric patients with pruritus and paraneoplastic pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fluvoxamine 25 to 150 mg per day",
"       </td>",
"       <td>",
"        Consider in psychiatric patients with pruritus and paraneoplastic pruritus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sertraline 75 to 100 mg per day",
"       </td>",
"       <td>",
"        Useful in cholestatic pruritus",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         &micro;-opioid receptor antagonists",
"        </strong>",
"       </td>",
"       <td>",
"        Naltrexone 25 to 50 mg per day",
"       </td>",
"       <td>",
"        Useful in patients with cholestatic and CKD-associated pruritus; may cause nausea, vomiting and drowsiness; reverses analgesia and may precipitate acute withdrawal in patients receiving opioid analgesics",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         &kappa;-opioid receptor agonist/&micro;-opioid receptor antagonist",
"        </strong>",
"       </td>",
"       <td>",
"        Butorphanol 1 to 4 mg intranasally per day",
"       </td>",
"       <td>",
"        Useful in nocturnal and intractable pruritus; may cause nausea and vomiting as well as drowsiness; may precipitate acute withdrawal in patients receiving opioid analgesics; some potential for abuse due to concomitant weak &micro;-opioid receptor agonist activity",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Selective &kappa;-opioid receptor agonist",
"        </strong>",
"       </td>",
"       <td>",
"        Nalfurafine 2.5 to 5 micrograms per day",
"       </td>",
"       <td>",
"        Useful in CKD-associated pruritus; may cause insomnia; approved in Japan only",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <strong>",
"         Anticonvulsants",
"        </strong>",
"       </td>",
"       <td>",
"        Gabapentin 100 to 3600 mg per day",
"       </td>",
"       <td rowspan=\"2\">",
"        Applies to both: useful in neuropathic pruritus, may cause drowsiness and weight gain; usually given in two to three divided daily doses; dose alteration for renal insufficiency may be needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pregabalin 150 to 300 mg per day",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Substance P antagonist",
"        </strong>",
"       </td>",
"       <td>",
"        Aprepitant 80 mg per day",
"       </td>",
"       <td>",
"        Beneficial in pruritus associated with the S&eacute;zary syndrome; expensive",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CKD: chronic kidney disease; SNRI: selective neuroepinephrine reuptake inhibitor; SSRI: selective serotonin reuptake inhibitor.",
"     <br>",
"      * Immunosuppressive agents such as cyclosporine, azathioprine, and mycophenolate mofetil may be beneficial for pruritus in severe atopic dermatitis (see \"Management of severe refractory atopic dermatitis\").",
"      <br>",
"       <font class=\"bullet\">",
"        &bull;",
"       </font>",
"       All doses are for adult patients, oral administration, unless noted otherwise.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     From: Patel T, Yosipovitch G. Therapy of pruritus. Expert Opin Pharmacother 2010; 11:1673. Copyright &copy; 2010 Informa Healthcare. Adapted with permission of Informa Healthcare.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f1_33_1566=[""].join("\n");
