var title_f1_33_1567="Stem cell properties";
var content_f1_33_1567=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F77910&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F77910&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 545px\">",
"   <div class=\"ttl\">",
"    Stem cell properties",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 525px; height: 302px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Schematic view of some general properties and assays for the heterogeneous cells that compromise the stem cell and progenitor cell compartments. As indicated, cells capable of permanently reconstituting in vivo hematopoiesis are separable from cells that give rise to day 12 CFU-S, but the precise developmental stage of in vitro long-term culture initiating cells (LTC- IC), cobblestone area forming cells (CAFC), CFU-blast and high proliferative potential colony forming cells (HPP-CFC) is not established. In the progenitor compartment, mixed colonies of almost all lineage combinations have been described.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
